import React from "react";
import { Col, Row } from "react-bootstrap";
import "./Contact.css";
import contact from '../../img/contact.png'

const Contact = () => {
    return (
        <div className="contact-banner">
            <Row>
                <Col>
                        <img style={{width:'500px'}} src={contact} alt="" />
                </Col>
                <Col>

                </Col>
            </Row>
        </div>
    );
};

export default Contact;
